import React, { Component } from "react";
import "./App.css";

function App() {
  const headingStyle = {
    color: "white",
    fontWeight: "bold",
    alignText: "center",
    fontSize:"100px"
  }

  return (
    <div className="App">
      <h1 style={headingStyle}>Urban Food</h1>
    </div>
  );
}


export default App;
